            <p>CollabyU est un créateur de belle histoire. On peut grâce à ce réseau social, permettre de belles collaborations entre différents passionnés de musique ou encore l’émergence de nouveaux styles musicaux. Notre projet permet de se créer un réseau, et de trouver les profils avec lesquels il est possible de collaborer afin de se faire une place dans le monde de la musique !</p>
